                "comm.title.msg17": "\uc77c\ud3c9\uade0 \uc2dc\uc138 | \uc774\uc6a9\uc548\ub0b4 | \uace0\uac1d\uc9c0\uc6d0 | \ube57\uc378(bithumb)",
