                "comm.title.msg20": "\uac1c\uc778\uc815\ubcf4 \ucc98\ub9ac\ubc29\uce68 | \ube57\uc378(bithumb)",
                "comm.title.msg21": "\uace0\uc815\ud615 \uc601\uc0c1\uc815\ubcf4\ucc98\ub9ac\uae30\uae30 \uc6b4\uc601\xb7\uad00\ub9ac \ubc29\uce68 | \ube57\uc378(bithumb)",
                "comm.title.msg22": "\uc790\ub3d9 \ucc28\uc775\uac70\ub798 | \uc790\ub3d9\ub9e4\ub9e4(\ubd07) | \ud61c\ud0dd\xb7\uc11c\ube44\uc2a4 | \ube57\uc378(bithumb)",
                "comm.desc.msg00": "\uc27d\uace0 \uc548\uc804\ud55c \uac00\uc0c1\uc790\uc0b0 \ud50c\ub7ab\ud3fc \ube57\uc378\uc740 \ube44\ud2b8\ucf54\uc778, \uc774\ub354\ub9ac\uc6c0, \ub9ac\ud50c \ub4f1 \uac00\uc0c1\uc790\uc0b0 \uac70\ub798\uc640 \ucf54\uc778\uc2dc\uc138 \ud655\uc778, \uc790\ub3d9\ub9e4\ub9e4, \uc2a4\ud14c\uc774\ud0b9 \ub4f1 \ub2e4\uc591\ud55c \uac00\uc0c1\uc790\uc0b0 \uc11c\ube44\uc2a4\ub97c \uc81c\uacf5\ud569\ub2c8\ub2e4. | \ube57\uc378",
                "comm.desc.msg01": "{{coinName}} \uc2dc\uc138, \uac00\uaca9, \uac70\ub798 \uc815\ubcf4 \ubc0f \uc0c1\uc138 \ub0b4\uc5ed\uc744 \ube57\uc378\uc5d0\uc11c \ud655\uc778\ud558\uace0 \uac70\ub798\ud574\ubcf4\uc138\uc694. | \ube57\uc378(bithumb)",
                "comm.desc.msg02": "{{coinName}} \ucd5c\uc885 \uccb4\uacb0\uac00\uc640 \uc8fc\ubb38\ud604\ud669 \ubc0f \uac70\ub798\uc644\ub8cc \ub0b4\uc5ed\uc744 \ube57\uc378\uc5d0\uc11c \ud655\uc778\ud574\ubcf4\uc138\uc694. | \ube57\uc378(bithumb)",
                "comm.desc.msg03": "\uac00\uc0c1\uc790\uc0b0 \ud50c\ub7ab\ud3fc \ube57\uc378 \uc774\ubca4\ud2b8 - {{eventTitle}} \uc785\ub2c8\ub2e4. \uc790\uc138\ud55c \ub0b4\uc6a9\uc740 \ud398\uc774\uc9c0 \ub0b4 \uae00\uc744 \ud1b5\ud574 \ud655\uc778\ud574 \ubcf4\uc138\uc694. {{eventDateTime}} | \ube57\uc378(bithumb)",
                "comm.desc.msg04": "\uac00\uc0c1\uc790\uc0b0 \ud50c\ub7ab\ud3fc \ube57\uc378 \uc774\ubca4\ud2b8 - \uc790\uc138\ud55c \ub0b4\uc6a9\uc740 \ud398\uc774\uc9c0 \ub0b4 \uae00\uc744 \ud1b5\ud574 \ud655\uc778\ud574 \ubcf4\uc138\uc694. | \ube57\uc378(bithumb)",
                "comm.desc.msg05": "\ube57\uc378\uc5d0\uc11c \ube44\ud2b8\ucf54\uc778, \ub3c4\ubbf8\ub10c\uc2a4 \ub4f1\uc758 \uac00\uc0c1\uc790\uc0b0 \uad00\ub828 \uc2dc\uc7a5\uc758 \ucd5c\uc2e0 \ub3d9\ud5a5\uacfc  \ucf54\uc778\uc2dc\uc138, \ube14\ub85d\uccb4\uc778 \ub4f1 \ub2e4\uc591\ud55c \uc815\ubcf4\ub97c \ud655\uc778\ud574 \ubcf4\uc138\uc694. | \ube57\uc378",
                "comm.desc.msg06": "\ube44\ud2b8\ucf54\uc778, \uc774\ub354\ub9ac\uc6c0, BNB, \uc194\ub77c\ub098 \ub4f1 \uc8fc\uc694 \uac00\uc0c1\uc790\uc0b0\uc758 \uc2e4\uc2dc\uac04 \uc2dc\uc138\uc640 \uc2dc\uc7a5 \ubcc0\ub3d9\uc131\uc744 \ube57\uc378 \uae00\ub85c\ubc8c \uc2dc\uc138 \ud398\uc774\uc9c0\uc5d0\uc11c \ud655\uc778\ud558\uace0 \ud22c\uc790 \uacb0\uc815\uc744 \uc704\ud55c \ucd5c\uc2e0 \uc815\ubcf4\ub97c \uc5bb\uc5b4\ubcf4\uc138\uc694. | \ube57\uc378",
                "comm.desc.msg07": "\ube57\uc378 \ud3ec\uc778\ud2b8 \ud398\uc774\uc9c0\uc5d0\uc11c \uac70\ub798 \uae08\uc561\uc5d0 \ub530\ub77c \ub9e4\uc77c \ucd5c\ub300 10\ub9cc \ud3ec\uc778\ud2b8\ub97c \uc801\ub9bd\ud558\uc138\uc694! \uc801\ub9bd\ub41c \ud3ec\uc778\ud2b8\ub294 \ud3ec\uc778\ud2b8\uc0f5\uc5d0\uc11c \uac00\uc0c1\uc790\uc0b0\uc73c\ub85c \uad50\ud658 \uac00\ub2a5\ud569\ub2c8\ub2e4. | \ube57\uc378",
                "comm.desc.msg08": "\ube57\uc378 \uba64\ubc84\uc2ed\uc740 \ub4f1\uae09\ubcc4\ub85c \ud3ec\uc778\ud2b8\uc640 \uac70\ub798 \ub9ac\uc6cc\ub4dc \ud61c\ud0dd\uc744 \uc81c\uacf5\ud569\ub2c8\ub2e4. \ub4f1\uae09\ubcc4\ub85c \uc313\uc774\ub294 \ud61c\ud0dd\uc744 \ud655\uc778\ud558\uc138\uc694. | \ube57\uc378",
                "comm.desc.msg09": "\uc774\ub354\ub9ac\uc6c0, \uc194\ub77c\ub098 \ub4f1 PoS \uc790\uc0b0\uc744 \ube57\uc378\uc5d0\uc11c \uc2a4\ud14c\uc774\ud0b9\ud558\uace0, \ub9e4\uc77c \ucd5c\ub300 4.02% \ubcf4\uc0c1\uc744 \ubc1b\uc544\ubcf4\uc138\uc694. \uac04\ud3b8\ud558\uac8c \uc2dc\uc791\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. | \ube57\uc378",
                "comm.desc.msg10": "\uac00\uc0c1\uc790\uc0b0\uc744 \ube4c\ub9ac\uace0 \uc0c1\uc2b9\uc7a5\uacfc \ud558\ub77d\uc7a5\uc5d0\uc11c \uc218\uc775\uc744 \ub0bc \uc218 \uc788\ub294 \ube57\uc378 \ub80c\ub529 \uc11c\ube44\uc2a4\ub97c \uc774\uc6a9\ud574\ubcf4\uc138\uc694. \uc0c1\uc2b9 \uc2dc \ucc28\uc775 \uc2e4\ud604, \ud558\ub77d \uc2dc \uc800\uac00 \ub9e4\uc785\uc744 \ud1b5\ud574 \uc774\uc775\uc744 \uc5bb\uc2b5\ub2c8\ub2e4. | \ube57\uc378",
                "comm.desc.msg11": "\ube57\uc378 \uc790\ub3d9\ub9e4\ub9e4 \uc11c\ube44\uc2a4\ub97c \ud1b5\ud574 \uc790\ub3d9 \ub9e4\uc218\xb7\ub9e4\ub3c4\ud558\uc5ec \ud3b8\ub9ac\ud558\uac8c \uac70\ub798\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. | \ube57\uc378",
                "comm.desc.msg12": "\uac00\uc0c1\uc790\uc0b0 \uac70\ub798\uc18c \ube57\uc378 \ub85c\uadf8\uc778 \ud398\uc774\uc9c0\uc785\ub2c8\ub2e4. \uacc4\uc815\uc5d0 \uc811\uc18d\ud558\uace0, \ucf54\uc778\uac70\ub798 \ubc0f \uad00\ub9ac \uae30\ub2a5\uc744 \uc774\uc6a9\ud574 \ubcf4\uc138\uc694. | \ube57\uc378",
                "comm.desc.msg13": "\uac00\uc0c1\uc790\uc0b0 \ud50c\ub7ab\ud3fc \ube57\uc378 \uc774\ubca4\ud2b8 \ud398\uc774\uc9c0\uc785\ub2c8\ub2e4. \ucd5c\uc2e0 \ud504\ub85c\ubaa8\uc158, \uc774\ubca4\ud2b8 \ubc0f \uc5c5\ub370\uc774\ud2b8 \uc18c\uc2dd\uc744 \ud655\uc778\ud558\uace0, \ub2e4\uc591\ud55c \uc815\ubcf4\uc640 \ud61c\ud0dd\uc744 \ub193\uce58\uc9c0 \ub9c8\uc138\uc694. | \ube57\uc378",
                "comm.desc.msg14": "\ube57\uc378\uc740 \uad6d\ub0b4 \ucd5c\uc800 \uc218\uc900 \uc218\uc218\ub8cc\ub97c \uc81c\uacf5\ud569\ub2c8\ub2e4. \uc6d0\ud654 \ub9c8\ucf13 0.04%, BTC\ub9c8\ucf13 \uc218\uc218\ub8cc \ubb34\ub8cc. \ub4f1\uae09\ubcc4 \uba54\uc774\ucee4 \ub9ac\uc6cc\ub4dc\uc640 \ud2b9\ubcc4 \ub9ac\uc6cc\ub4dc\ub97c \ud3ec\ud568\ud55c \uba64\ubc84\uc2ed \ud61c\ud0dd\ub3c4 \ud655\uc778\ud574\ubcf4\uc138\uc694 | \ube57\uc378",
                "comm.desc.msg15": "\ube57\uc378\uc5d0\uc11c\ub294 \uc785\uae08 \uc218\uc218\ub8cc \ubb34\ub8cc, \ucd9c\uae08 \uc2dc \uac00\uc0c1\uc790\uc0b0\ubcc4\ub85c \uc218\uc218\ub8cc\uac00 \ubd80\uacfc\ub429\ub2c8\ub2e4. \uc790\uc138\ud55c \ub0b4\uc6a9\uc740 \ud398\uc774\uc9c0\ub97c \ud1b5\ud574 \ud655\uc778\ud574\ubcf4\uc138\uc694. | \ube57\uc378",
                "comm.desc.msg16": "\uc785\ucd9c\uae08 \ud604\ud669 \ud398\uc774\uc9c0\uc785\ub2c8\ub2e4. \ube44\ud2b8\ucf54\uc778, \uc774\ub354\ub9ac\uc6c0, \ub9ac\ud50c \ub4f1 \uac00\uc0c1\uc790\uc0b0\uc758 \uc785\ucd9c\uae08 \ud604\ud669\uc744 \ud655\uc778\ud574 \ubcf4\uc138\uc694. | \ube57\uc378",
                "comm.desc.msg17": "\ube44\ud2b8\ucf54\uc778(BTC), \uc774\ub354\ub9ac\uc6c0(ETH), \ub9ac\ud50c(XRP) \ub4f1 \uac00\uc0c1\uc790\uc0b0 \uc77c\ud3c9\uade0 \uc2dc\uc138 \ud398\uc774\uc9c0\uc5d0\uc11c \ud655\uc778\ud558\uc138\uc694. | \ube57\uc378",
                "comm.desc.msg18": "\ube57\uc378\uc758 \uc774\uc6a9\uc57d\uad00 \ud398\uc774\uc9c0\uc785\ub2c8\ub2e4. \uc11c\ube44\uc2a4 \uc774\uc6a9 \uc870\uac74 \ubc0f \uc808\ucc28\uc5d0 \uad00\ud55c \ud68c\uc0ac\uc640 \ud68c\uc6d0 \uac04\uc758 \uad8c\ub9ac\xb7\uc758\ubb34 \ubc0f \ucc45\uc784\uc0ac\ud56d\uc744 \uaddc\uc815\ud558\ub294 \ud398\uc774\uc9c0\uc785\ub2c8\ub2e4. | \ube57\uc378",
                "comm.desc.msg19": "\ube57\uc378 API \uc774\uc6a9\uc57d\uad00\uc740 \uc815\ubcf4 API \uc0ac\uc6a9 \uc2dc \uc900\uc218\ud574\uc57c \ud560 \uaddc\uce59\uacfc \uc9c0\uce68\uc744 \ub2e4\ub8f9\ub2c8\ub2e4. \uc0ac\uc6a9\uc790\ub294 \uc57d\uad00\uc744 \uc900\uc218\ud574\uc57c \ud558\uba70, \uc704\ubc18 \uc2dc API \uc811\uadfc\uc774 \uc81c\ud55c\ub420 \uc218 \uc788\uc2b5\ub2c8\ub2e4. | \ube57\uc378",
                "comm.desc.msg20": "\u321c\ube57\uc378\ucf54\ub9ac\uc544\ub294 \uac1c\uc778\uc815\ubcf4\ubcf4\ud638\ubc95\uc744 \uc900\uc218\ud558\uba70, \uac1c\uc778\uc815\ubcf4\ucc98\ub9ac\ubc29\uce68\uc744 \ud1b5\ud574 \uace0\uac1d\uc758 \uac1c\uc778\uc815\ubcf4\ub97c \uc548\uc804\ud558\uac8c \uad00\ub9ac\ud569\ub2c8\ub2e4. | \ube57\uc378",
                "comm.desc.msg21": "\ube57\uc378\ucf54\ub9ac\uc544\uc758 \uace0\uc815\ud615 \uc601\uc0c1\uc815\ubcf4\ucc98\ub9ac\uae30\uae30 \uc6b4\uc601 \uad00\ub9ac\ubc29\uce68\uc740 \uace0\uac1d\uc758 \uc815\ubcf4 \ubcf4\ud638\ub97c \ucd5c\uc6b0\uc120\uc73c\ub85c \ud558\uba70, \uc601\uc0c1\uc815\ubcf4\uac00 \uc5b4\ub5a0\ud55c \uc6a9\ub3c4\uc640 \ubc29\uc2dd\uc73c\ub85c \uc774\uc6a9\xb7\uad00\ub9ac\ub418\uace0 \uc788\ub294\uc9c0 \uc54c\ub824\ub4dc\ub9bd\ub2c8\ub2e4. | \ube57\uc378",
                "comm.desc.msg22": "\uc790\ub3d9 \ucc28\uc775\uac70\ub798 \uc11c\ube44\uc2a4\ub85c \uac04\ud3b8\ud558\uac8c \ucc28\uc775\uac70\ub798\ub97c \uc2dc\uc791\ud574\ubcf4\uc138\uc694 | \ube57\uc378",
