                "info.kyc.msg03": "\uae08\uc735\uae30\uad00 \ub4f1\uc774 \uc81c\uacf5\ud558\ub294 \uc0c1\ud488 \ubc0f \uc11c\ube44\uc2a4\uac00 \uc790\uae08\uc138\ud0c1 \ub4f1\uc758 \ubd88\ubc95\ud589\uc704\uc5d0 \uc774\uc6a9\ub418\uc9c0 \uc54a\ub3c4\ub85d \uace0\uac1d\uc758 \uc2e0\uc6d0\ud655\uc778 \ubc0f \uac80\uc99d, \uac70\ub798\uad00\uacc4\uc758 \ubaa9\uc801 \ubc0f \uc2e4\uc18c\uc720\uc790 \ud655\uc778 \ub4f1 \uace0\uac1d\uc5d0 \ub300\ud574 \ud569\ub2f9\ud55c \uc8fc\uc758\ub97c \uae30\uc6b8\uc774\ub3c4\ub85d \ud558\ub294 \uc81c\ub3c4\uc785\ub2c8\ub2e4.",
