                "info.kyc.msg24": "\uc2e0\ubd84\uc99d \uc9c4\uc704 \ud655\uc778\ubd80\ud130 24\uc2dc\uac04 \uc774\ub0b4 \ub0a8\uc740 \ub2e8\uacc4\ub97c \uc774\uc5b4\uc11c \ub4f1\ub85d\ud558\uc2e4 \uc218 \uc788\uc2b5\ub2c8\ub2e4.",
                "info.kyc.msg25": "\ucd94\uac00 \uc815\ubcf4 \uc81c\ucd9c\uc740 \uc5b4\ub5a4\uac74\uac00\uc694?",
                "info.kyc.msg26": "\uc77c\ubd80 \uace0\uac1d\uc740 \ucd94\uac00 \uc2ec\uc0ac\uac00 \uc9c4\ud589\ub420 \uc218 \uc788\uc73c\uba70, \uac1c\uc778\uc6a9 \ucd94\uac00 \uc815\ubcf4 \ud655\uc778\uc11c \ubc0f \uc18c\ub4dd \uc99d\ube59\ud560 \uc218 \uc788\ub294 \ud30c\uc77c\uc744 \uc774\uba54\uc77c\ub85c \uc81c\ucd9c\ud558\uc154\uc57c \ud569\ub2c8\ub2e4.(\ud68c\uc6d0\uc815\ubcf4 \uad00\ub9ac > \ucd94\uac00 \uc815\ubcf4 \uc81c\ucd9c \uc548\ub0b4)",
                "info.kyc.msg27": "\ubc18\ub824\ub418\uba74 \uc5b4\ub5bb\uac8c \ub418\ub098\uc694?",
                "info.kyc.msg28": "\ub0b4\uad6d\uc778\uc740 \uace0\uac1d\ud655\uc778\uc774 \ubc18\ub824\ub418\uba74 \uc54c\ub9bc\ud1a1(SMS)\ub97c \ud1b5\ud574 \uc548\ub0b4\ud574 \ub4dc\ub9ac\uba70,  \ubc18\ub824\uc77c\ub85c\ubd80\ud130 7\uc77c \uc774\ub0b4\uc5d0 \uace0\uac1d\ud655\uc778\uc744 \uc7ac\ub4f1\ub85d \ud574\uc57c \ud569\ub2c8\ub2e4. \uc7ac\ub4f1\ub85d\uc744 \ud558\uc9c0 \uc54a\uc73c\uba74 7\uc77c \ud6c4 \uc11c\ube44\uc2a4 \uc774\uc6a9\uc774 \ucc28\ub2e8\ub429\ub2c8\ub2e4.",
                "info.kyc.msg29": "\uc11c\ube44\uc2a4 \uc774\uc6a9 \ucc28\ub2e8 \ud6c4\uc5d0\ub294 \uace0\uac1d\ud655\uc778\uc744 \ubabb\ud558\ub098\uc694?",
                "info.kyc.msg30": "\ucc28\ub2e8\ub41c \ud6c4 \uace0\uac1d\ud655\uc778 \ub4f1\ub85d\uc740 \uac00\ub2a5\ud558\uc9c0\ub9cc, \ube57\uc378 \uc6b4\uc601\uc790 \uc2b9\uc778\uc744 \ubc1b\uc740 \ud6c4\uc5d0 \uc774\uc6a9\ud558\uc2e4 \uc218 \uc788\uc2b5\ub2c8\ub2e4.",
                "info.kyc.msg31": "\uc11c\ube44\uc2a4 \uc774\uc6a9 \ubd88\uac00\ub77c\uace0 \ub739\ub2c8\ub2e4.",
                "info.kyc.msg32": "\uace0\uac1d\ud655\uc778 \uacb0\uacfc [\uc790\uae08\uc138\ud0c1\ubc29\uc9c0 \ubc0f \uacf5\uc911\ud611\ubc15\uc790\uae08\uc870\ub2ec \uae08\uc9c0\uc5d0 \uad00\ud55c \uc5c5\ubb34 \uaddc\uc815] \uc81c43\uc870\uc5d0 \uc758\uac70\ud55c \uc694\uc8fc\uc758 \uc778\ubb3c\ub85c \ud655\uc778\ub418\ub294 \uacbd\uc6b0 \uc11c\ube44\uc2a4 \uc774\uc6a9\uc774 \ubd88\uac00\ud558\uba70, \uc774\uc6a9 \uc911\uc778 \ubaa8\ub4e0 \uc11c\ube44\uc2a4\uac00 \ucde8\uc18c \ucc98\ub9ac\ub429\ub2c8\ub2e4. \uc0c1\uc138 \uc0ac\uc720\ub294 \uace0\uac1d\uc13c\ud130(1661-5566) \ub610\ub294 \ud648\ud398\uc774\uc9c0 > \uac8c\uc2dc\ud310 \ubb38\uc758\ub97c \ud1b5\ud574 \ud655\uc778\ud558\uc138\uc694.",
                "info.kyc.msg33": "\uc790\uae08\uc138\ud0c1\uc774 \ubb54\uac00\uc694?",
                "info.kyc.msg34": "\ubd88\ubc95\uc7ac\uc0b0\uc758 \ucde8\ub4dd\xb7\ucc98\ubd84 \ub610\ub294 \ubc1c\uc0dd \uc6d0\uc778\uc5d0 \uad00\ud55c \uc0ac\uc2e4\uc744 \uc228\uae30\uace0 \ud569\ubc95\uc801\uc778 \uc790\uc0b0\uc778 \uac83\ucc98\ub7fc \uc740\ub2c9\ud558\ub294 \ud589\uc704\ub97c \ub9d0\ud569\ub2c8\ub2e4.",
                "info.kyc.msg35": "\uace0\uac1d\ud655\uc778\uc740 \ud55c \ubc88\ub9cc \ud558\uba74 \ub418\ub098\uc694?",
                "info.kyc.msg36": "[\uc790\uae08\uc138\ud0c1\ubc29\uc9c0 \ubc0f \uacf5\uc911\ud611\ubc15\uc790\uae08\uc870\ub2ec \uae08\uc9c0\uc5d0 \uad00\ud55c \uc5c5\ubb34 \uaddc\uc815] \uc81c34\uc870(\uc9c0\uc18d\uc801\uc778 \uace0\uac1d\ud655\uc778)\uc5d0 \uc758\uac70\ud558\uc5ec \uc11c\ube44\uc2a4\ub97c \uc774\uc6a9 \uc911\uc778 \uace0\uac1d\uc740 \uc8fc\uae30\uc801\uc73c\ub85c \uace0\uac1d\ud655\uc778\uc744 \uc7ac\uc774\ud589 \ud574\uc57c \ud569\ub2c8\ub2e4. \uc7ac\uc774\ud589 \uc8fc\uae30\ub294 \uace0\uac1d\uc758 \uc704\ud5d8\ub3c4 \ud3c9\uac00\uc5d0 \ub530\ub77c 3\ub144/1\ub144/6\uac1c\uc6d4 \ub2e8\uc704\ub85c \uc124\uc815\ub418\uba70, \uc7ac\uc774\ud589 \uc885\ub8cc\uc77c \ud55c \ub2ec \uc804\ubd80\ud130 \uc54c\ub9bc\ud1a1\uacfc \uc774\uba54\uc77c\uc744 \ud1b5\ud574 \uc548\ub0b4\ud574 \ub4dc\ub9bd\ub2c8\ub2e4.",
                "info.kyc.msg37": "\ud734\ub300\ud3f0\ubc88\ud638 \ub85c\uadf8\uc778 \ubc0f \ud734\uba74 \ud68c\uc6d0\ub3c4 \uace0\uac1d\ud655\uc778\uc744 \ud560 \uc218 \uc788\ub098\uc694?",
                "info.kyc.msg38": "\ud734\ub300\ud3f0\ubc88\ud638 \ub85c\uadf8\uc778 \ud68c\uc6d0\uc740 \uc774\uba54\uc77c \uacc4\uc815\uc744 \ub4f1\ub85d \ud6c4, \ud734\uba74 \ud68c\uc6d0\uc740 \ud734\uba74 \ud574\uc81c \ud6c4 \ub4f1\ub85d \uac00\ub2a5\ud569\ub2c8\ub2e4.",
                "info.kyc.msg39": "\uacc4\uc815\uc774 \uc5ec\ub7ec \uac1c\uba74 \uc5b4\ub5bb\uac8c \ud574\uc57c \ub418\ub098\uc694?",
                "info.kyc.msg40": "1\uc778 1\uacc4\uc815 \uc0ac\uc6a9 \uc6d0\uce59\uc5d0 \ub530\ub77c \uace0\uac1d\ud655\uc778 \ub4f1\ub85d\uc740 1\uac1c \uacc4\uc815\ub9cc \ud558\uba74 \ub429\ub2c8\ub2e4. \ub2e8 \uc5ec\ub7ec \uacc4\uc815\uc5d0 \uc790\uc0b0\uc774 \uc788\ub294 \uacbd\uc6b0 \uac01\uac01 \uace0\uac1d\ud655\uc778\uc744 \ub4f1\ub85d\ud574\uc57c \ud569\ub2c8\ub2e4.",
                "info.kyc.msg43": "\uc678\uad6d\uc778\ub3c4 \uace0\uac1d\ud655\uc778\uc744 \ud560 \uc218 \uc788\ub098\uc694?",
                "info.kyc.msg44": "\ud734\ub300\ud3f0 \ubcf8\uc778\ud655\uc778\uc774 \uac00\ub2a5\ud55c \uad6d\ub0b4 \uac70\uc8fc \uc678\uad6d\uc778\uc740 \uace0\uac1d\ud655\uc778\uc744 \ub4f1\ub85d \ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.{{tag/}}\u203b \ud574\uc678 \uac70\uc8fc \uc678\uad6d\uc778\uc740 \uace0\uac1d\ud655\uc778\uc744 \ub4f1\ub85d \ud560 \uc218 \uc5c6\uc2b5\ub2c8\ub2e4.",
