                "page.list.msg24": "\uac00\uc0c1\uc790\uc0b0\uc758 \uc720\ub3d9\uc131, \uc2dc\uac00\ucd1d\uc561, \ud504\ub85c\uc81d\ud2b8\uc758 \uac74\uc804\uc131 \ub4f1 \uc885\ud569\uc801\uc778 \uc9c0\ud45c\ub97c \uac80\ud1a0\ud558\uc5ec \uc120\uc815\ub418\uba70 \ub2e4\ub978 \ub9c8\ucf13\uc5d0 \ube44\ud574 \ud22c\uc790 \uc548\uc815\uc131\uc774 \ub192\uc740 \uc790\uc0b0\uc785\ub2c8\ub2e4. \uba54\uc774\uc800 \ub9c8\ucf13\uc740 \uc218\uc2dc\ub85c \ubcc0\uacbd \ub420 \uc218 \uc788\uc2b5\ub2c8\ub2e4.",
                "page.list.msg25": "\uba54\uc774\uc800, \uc2e0\uaddc, \uac70\ub798\uc720\uc758\ub85c \ubd84\ub958\ub418\uc9c0 \uc54a\uc740 \uac00\uc0c1\uc790\uc0b0\uc73c\ub85c, \uba54\uc774\uc800 \ub9c8\ucf13\uc5d0 \ube44\ud574 \ud22c\uc790 \uc548\uc815\uc131\uc774 \ub0ae\uc544 \uc2dc\uc138 \ubcc0\ub3d9\uc774 \ud074 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc77c\ubc18 \ub9c8\ucf13\uc758 \uac00\uc0c1\uc790\uc0b0\uc740 \uba54\uc774\uc800\ub098 \uac70\ub798\uc720\uc758\ub85c \ubcc0\uacbd\ub420 \uc218 \uc788\uc2b5\ub2c8\ub2e4.",
                "page.list.msg26": "\ucd5c\uadfc \uc2e0\uaddc \uc0c1\uc7a5 \ub41c \uac00\uc0c1\uc790\uc0b0\uc73c\ub85c, \uac01 \uac00\uc0c1\uc790\uc0b0\uc758 \uc0c1\uc138 \uc815\ubcf4\ub294 \uac00\uc0c1\uc790\uc0b0 \uac80\ud1a0\ubcf4\uace0\uc11c\uc5d0\uc11c \ud655\uc778\ud558\uc2e4 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc2dc\uc138 \ubcc0\ub3d9\uc774 \ud074 \uc218 \uc788\uc73c\ub2c8 \ud22c\uc790\uc5d0 \uc720\uc758\ud558\uc5ec \uc8fc\uc2dc\uae30 \ubc14\ub78d\ub2c8\ub2e4.",
                "page.list.msg27": "\ube57\uc378 \uac00\uc0c1\uc790\uc0b0 \uac70\ub798\uc720\uc758\uc885\ubaa9 \uc9c0\uc815 \uc815\ucc45\uc5d0 \ub530\ub77c \uac70\ub798\uc720\uc758\uc885\ubaa9\uc73c\ub85c \uc9c0\uc815\ub41c \uac00\uc0c1\uc790\uc0b0\uc785\ub2c8\ub2e4. \uae09\uaca9\ud55c \uac00\uaca9\ubcc0\ub3d9\uc5d0 \uc720\uc758\ud558\uc5ec \uc8fc\uc2dc\uae30 \ubc14\ub78d\ub2c8\ub2e4.",
