                "trade.notice.modal.msg03": "\uac00\uc0c1\uc790\uc0b0 \uac70\ub798 \uc720\uc758 \uc0ac\ud56d",
                "trade.notice.modal.msg04": "\uc704 \uc0ac\ud56d\ub4e4\uc740 \uac00\uc0c1\uc790\uc0b0 \uac70\ub798\uc5d0 \uc218\ubc18\ub418\ub294 \uc704\ud5d8 \ub4f1\uc5d0 \ub300\ud574 \ud68c\uc6d0\ub2d8\uc774 \uc54c\uc544\uc57c \ud560 \uc0ac\ud56d\uc744 \uac04\ub7b5\ud558\uac8c \uc11c\uc220\ud55c \uac83\uc73c\ub85c \uac00\uc0c1\uc790\uc0b0 \uac70\ub798\uc640 \uad00\ub828\ub41c \ubaa8\ub4e0 \uc704\ud5d8\uc744 \uae30\uc220 \ud55c \uac83\uc740 \uc544\ub2d9\ub2c8\ub2e4. {{tag/}} \ub610\ud55c \ubcf8 \uace0\uc9c0 \ub0b4\uc6a9\uc740 \uac70\ub798\uc18c\uc758 \uc774\uc6a9\uc57d\uad00\uc774\ub098 \uad6d\ub0b4\uc678 \uad00\ub828\ubc95\uaddc \ub4f1\uc5d0 \uc6b0\uc120\ud558\uc9c0 \ubabb\ud55c\ub2e4\ub294 \uc810\uc744 \uc591\uc9c0\ud558\uc5ec \uc8fc\uc2dc\uae30 \ubc14\ub78d\ub2c8\ub2e4.",
                "trade.notice.modal.msg05": "\uac00\uc0c1\uc790\uc0b0\uc740 \ubc95\uc815\ud654\ud3d0\uac00 \uc544\ub2c8\ubbc0\ub85c \ud2b9\uc815\uc8fc\uccb4\uac00 \uac00\uce58\ub97c \ubcf4\uc7a5\ud558\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.",
                "trade.notice.modal.msg06": "\uac00\uc0c1\uc790\uc0b0\uc740 365\uc77c 24\uc2dc\uac04 \uc804 \uc138\uacc4\uc5d0\uc11c \uac70\ub798\ub418\uba70, \uc2dc\uc7a5\uc758 \uc218\uc694 \ubc0f \uacf5\uae09, \uac01 \uac00\uc0c1\uc790\uc0b0\uc758 \uc815\ucc45, \uad6d\uac00\ubcc4 \ubc95\ub839 \ubc0f \uc81c\ub3c4, \ub124\ud2b8\uc6cc\ud06c \uc0c1\ud669 \ub4f1 \ub2e4\uc591\ud55c \uc694\uc778\uc73c\ub85c \uae09\uaca9\ud55c \uc2dc\uc138 \ubcc0\ub3d9\uc774 \ubc1c\uc0dd\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.",
