                "page.trading.competition.msg087": "\ub300\ud68c \ucc38\uc5ec\uc790\ub4e4\uc758 \ub7ad\ud0b9\uc740 \uc7a0\uc2dc\ud6c4 \uacf5\uac1c\ub429\ub2c8\ub2e4!",
